import logo from "./logo.svg";
import "./App.css";
import React, { useState } from "react";

function App() {
  const [data, setData] = useState();

  return (
    <div className="App">
      <header className="App-header">
        <img src={logo} className="App-logo" alt="logo" />
        <>
          <div className="get-data">
            <input type="file"></input>
          </div>
        </>
      </header>
    </div>
  );
}

export default App;
